&lt;p&gt;In the question, a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement&lt;/strong&gt;: Should one year of army training be compulsory for all Indian citizens?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I&lt;/strong&gt;: No, the costs of training will be prohibitive and one year of labour will be lost.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument II&lt;/strong&gt;: Yes, army training helps make better citizens.&lt;/p&gt;

hn.value:
&lt;p&gt;निम्न प्रश्न में एक कथन और उसके बाद I तथा II से अंकित दो तर्क दिए गए हैं। आपको दिए गए कथन को सत्य मानना है भले ही वह ज्ञात तथ्यों से अलग प्रतीत हो। आपको तय करना है कि दिए गए तर्कों में से कौन सा तर्क, प्रबल&amp;nbsp;तर्क है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन&lt;/strong&gt;: क्या सभी भारतीय नागरिकों के लिए एक वर्ष का सैन्य प्रशिक्षण अनिवार्य होना चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क&lt;/strong&gt; &lt;strong&gt;I: &lt;/strong&gt;नहीं, प्रशिक्षण की लागत निषेधात्मक होगी और एक वर्ष का मेहनताना बर्बाद हो जाएगा।&lt;/p&gt;
&lt;strong&gt;तर्क II: &lt;/strong&gt;हां, सैन्य प्रशिक्षण बेहतर नागरिकों के निर्माण में मदद करता है।

